%cassandra
CREATE KEYSPACE IF NOT EXISTS flight_data
WITH replication = {'class': 'SimpleStrategy', 'replication_factor': 1};

%cassandra
SELECT * FROM system_schema.columns 
WHERE keyspace_name = 'flight_data' AND table_name = 'flights';

%cassandra
SELECT * FROM system_schema.columns 
WHERE keyspace_name = 'flight_data' AND table_name = 'flights_only_str';
